import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer>
      <p>Адрес: г. Москва, ул. Примерная д. 10 Телефон: 8 (999) 177-17-17 Электронная почта:
info@architecturecomfort.ru</p>
<p>Часы работы:
Пн - Пт: 10:00 - 19:00
Сб: 10:00 - 16:00
Вс: выходной</p>
    </footer>
  );
};

export default Footer;
